import React from 'react';

import { Text, Form, Button, Layout, Banner } from 'react-lifesg-design-system';
import { ThemeProvider } from "styled-components";
import styled from "styled-components";

interface Props {
    onChange: (fieldName: string, value: string) => void;
    onSave: () => void;
}

const StyledContainer = styled(Layout.GridContainer)`
    display: grid;
    grid-template-columns: 0 8fr 0;
`;

const StyledSection = styled(Layout.Section)`
    margin-top: 10%;
    min-height: 600px;
`;

const dashboard: React.FunctionComponent<Props> = (props) => {
  return (
    <StyledSection>
            <StyledContainer>
                <Banner imgset={{
                    desktop: 'https://www.life.gov.sg/img/what-you-can-do/government-services/hero-banner.jpg',
                    foreground: 'https://www.life.gov.sg/img/what-you-can-do/government-services/hero-banner-phone.png',
                    mobile: 'https://www.life.gov.sg/img/what-you-can-do/government-services/hero-banner.jpg'
                }}>
                <React.Fragment key=".0">
                    More than 40 government services in one app
                </React.Fragment>
                </Banner>

                <Layout.GridContent>
                    <Text.H3>Add Appointment</Text.H3>
                

                </Layout.GridContent>

                <Button.Default
                    onClick={props.onSave}
                >Add</Button.Default>

            </StyledContainer>
        </StyledSection>

  )
}

export default dashboard;
